package main

import "fmt"

func findMaxConsecutiveOnes(nums []int) int {
	// [1, 0, 1, 1, 0]
	// [1, 0, 0, 1, 0, 1]
	count := 0
	result := 0
	numZeros := 0
	for _, v := range nums {
		if v == 1 {
			count++
		} else {
			numZeros++
			if numZeros <= 1 {
				count++
			}

			if result < count {
				result = count
			}

			if numZeros > 1 {
				numZeros = 0
				count = 0
			}
		}
	}

	if count > result {
		result = count
	}

	fmt.Println(nums, result)

	return result
}

